import React from "react";

export const Navbar = () => {
  return (
      // <header className="flex justify-between items-center w-[1300px] h-[97px] mx-auto">
      //     <div className=" ">
      //       <img
      //         className="w-[120px] cursor-pointer"
      //         src="/Logo.svg"
      //         alt="..."
      //       />
      //     </div>
      //     <div className="duration-500 md:static absolute md:min-h-fit min-h-[60vh] left-0 top-[-100%] md:w-auto flex items-center px-5 text-[24px] font-inter ">
      //       <ul className="flex md:flex-row flex-col md:items-center md:gap-[4vw] gap-8 list-none">
      //         <li>
      //           <a className="" href="#">
      //             Home
      //           </a>
      //         </li>
      //         <li>
      //           <a className="" href="#">
      //             Tokenomicts
      //           </a>
      //         </li>
      //         <li>
      //           <a className="" href="#">
      //             Roadmap
      //           </a>
      //         </li>
      //         <li>
      //           <a className="" href="#">
      //             Community
      //           </a>
      //         </li>
      //         <li>
      //           <button className="bg-[#216BEB] text-white px-4 py-4 rounded-[54px] text-[24px] font-inter">
      //             Buy $TRT
      //           </button>
      //         </li>
      //       </ul>
      //     </div>

      
     
      // </header>
      

<nav className="bg-white border-gray-200 dark:bg-gray-900">
  <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
    <a href="https://flowbite.com/" className="flex items-center">
        <img src="https://flowbite.com/docs/images/logo.svg" className="h-8 mr-3" alt="Flowbite Logo" />
    </a>
    <button data-collapse-toggle="navbar-default" type="button" className="inline-flex items-center p-2 w-10 h-10 justify-center text-sm text-gray-500 rounded-lg md:hidden hover:bg-gray-100 focus:outline-none focus:ring-2 focus:ring-gray-200 dark:text-gray-400 dark:hover:bg-gray-700 dark:focus:ring-gray-600" aria-controls="navbar-default" aria-expanded="false">
        <span className="sr-only">Open main menu</span>
        <svg className="w-5 h-5" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 17 14">
            <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M1 1h15M1 7h15M1 13h15"/>
        </svg>
    </button>
    <div className="hidden w-full md:block md:w-auto" id="navbar-default">
      <ul className="font-medium flex flex-col p-4 md:p-0 mt-4 border border-gray-100 rounded-lg bg-gray-50 md:flex-row md:space-x-8 md:mt-0 md:border-0 dark:bg-gray-800 md:dark:bg-gray-900 dark:border-gray-700 list-none">
        <li>
          <a href="#" className="block py-2 pl-3 pr-4 text-white bg-blue-700 rounded md:bg-transparent md:text-blue-700 md:p-0 dark:text-white md:dark:text-blue-500" aria-current="page">Home</a>
        </li>
        <li>
        <a href="#" className="block py-2 pl-3 pr-4 text-white bg-blue-700 rounded md:bg-transparent md:text-blue-700 md:p-0 dark:text-white md:dark:text-blue-500" aria-current="page">About</a>
        </li>
        <li>
        <a href="#" className="block py-2 pl-3 pr-4 text-white bg-blue-700 rounded md:bg-transparent md:text-blue-700 md:p-0 dark:text-white md:dark:text-blue-500" aria-current="page">Services</a>
        </li>
        <li>
        <a href="#" className="block py-2 pl-3 pr-4 text-white bg-blue-700 rounded md:bg-transparent md:text-blue-700 md:p-0 dark:text-white md:dark:text-blue-500" aria-current="page">Pricing</a>
        </li>
        <li>
        <a href="#" className="block py-2 pl-3 pr-4 text-white bg-blue-700 rounded md:bg-transparent md:text-blue-700 md:p-0 dark:text-white md:dark:text-blue-500" aria-current="page">Contact</a>
        </li>
      </ul>
    </div>
  </div>
</nav>


  );
};
